import {NavLink} from "react-router-dom";
import Pagination from "./Paginator";
import User from "./User";

const Users = (props) => {

    return <div className={classes.user_card_wrap}>
<Pagination curentPage={ props.curentPage} onPageChanged={ props.onPageChanged}/>
        {
            props.users.map(u => <User user = {propsu} followingInProgress={props.followingInProgress} unfallow={props.unfallow} fallow={props.fallow} />)
        }
    </div>
}
